function getSongsInCart(){$.ajax({type:"GET",url:"http://www.alectrievel.com/schoolwork/CS0334/final/php/loadCart.php?type=music&user_id="+localStorage.logged_in,dataType:"application/json; charset=UTF8;",cache:!0,success:function(t){resetTable($("#tblMusic"))},complete:function(t){resetTable($("#tblMusic")),JSON.parse(t.responseText).forEach(t=>{displayCartResults("music",t)}),setupDataTables([$("#tblMusic")])}})}function getMoviesInCart(){$.ajax({type:"GET",url:"http://www.alectrievel.com/schoolwork/CS0334/final/php/loadCart.php?type=movie&user_id="+localStorage.logged_in,dataType:"application/json; charset=UTF8;",cache:!0,success:function(t){resetTable($("#tblMovie"))},complete:function(t){resetTable($("#tblMovie")),JSON.parse(t.responseText).forEach(t=>{displayCartResults("movie",t)}),setupDataTables([$("#tblMovie")])}})}function getTVInCart(){$.ajax({type:"GET",url:"http://www.alectrievel.com/schoolwork/CS0334/final/php/loadCart.php?type=tv&user_id="+localStorage.logged_in,dataType:"application/json; charset=UTF8;",cache:!0,success:function(t){resetTable($("#tblTV"))},complete:function(t){resetTable($("#tblTV")),JSON.parse(t.responseText).forEach(t=>{displayCartResults("tv",t)}),setupDataTables([$("#tblTV")])}})}function displayCartResults(t,e){const a=JSON.parse(e);null!==a&&("music"===t?$("#tblMusic tbody").append("<tr style='rgba(212, 212, 255, 0.035);'><td>"+a.name+"</td><td> "+a.artist+"</td><td>"+a.album+"</td><td>$"+a.price+"</td></tr>"):"tv"===t?$("#tblTV tbody").append("<tr style='rgba(212, 212, 255, 0.035);'><td>"+a.name+"</td><td>"+a.episode+"</td><td>"+a.genre+"</td><td>$"+a.price+"</td></tr>"):"movie"===t&&$("#tblMovie tbody").append("<tr style='rgba(212, 212, 255, 0.035);'><td>"+a.name+"</td><td>"+a.director+"</td><td>"+a.genre+"</td><td>$"+a.price+"</td></tr>"))}